import * as api from '../api';

const createAppointment = (customerData) => async (dispatch) => {
    try {
        const { data } = await api.createAppointment(customerData);
        dispatch ({ type: 'CREATE' , payload: data });
    } catch (error) {
        console.log(error)
    }
}

export default createAppointment;
